import React from "react";
import { useEffect } from "react";
import { useState } from "react";

function PhotoPage() {
  const [photos, setPhotos] = useState([]);

  useEffect(() => {
    fetch("https://picsum.photos/v2/list")
      .then((res) => res.json())
      .then((res) => {
        setPhotos(res);
        console.log(res);
      });
  }, []);
  return <></>;
}

export default PhotoPage;
